function handleResult(data){var status=data.status;var stdout=decodeURIComponent(escape(atob(data.stdout||"")));var stderr=decodeURIComponent(escape(atob(data.stderr||"")));var compile_output=decodeURIComponent(escape(atob(data.compile_output||"")));var message=decodeURIComponent(escape(atob(data.message||"")));var time=(data.time===null?"-":data.time+"s");var memory=(data.memory===null?"-":data.memory+"KB");$statusLine.html(`${status.description}, ${time}, ${memory}`);if(status.id==6){stdout=compile_output;}else if(status.id==13){stdout=message;}else if(status.id!==3&&stderr!==""){stdout+=(stdout===""?"":"\n")+stderr;}
outputEditor.setValue(stdout);updateEmptyIndicator();$runBtn.button("reset");};;$(window).load(function(){});